function r2PerfEEG = getNoiseIndex(fs, mtgLabels, dataWin)
    
    r2PerfEEG = 0;
    
    return;

    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);

    freqs = fs*(0:(nSamples/2))/nSamples;
    delSel = (freqs < 1) | (freqs > abs(fs/3));
    dataSpctrmAllChanns = zeros(nrMtgs, length(freqs));
    channSpecR2 = zeros(nrMtgs,1);
    for mi = 1:nrMtgs
        freqs = fs*(0:(nSamples/2))/nSamples;
        signal = dataWin(mi,:);

        Y = fft(signal);
        P2 = abs(Y/nSamples);
        dataSpctrm = P2(1:nSamples/2+1);
        dataSpctrm(2:end-1) = 2*dataSpctrm(2:end-1);
        dataSpctrm = real(dataSpctrm);

        dataSpctrmAllChanns(mi,:) = dataSpctrm;

        freqs(delSel) = [];
        dataSpctrm(:,delSel) = [];
        
        dataSpctrmNormLog = rescale(log10(dataSpctrm));
    
        [p, S] = polyfit(freqs, dataSpctrmNormLog, 10);
        [wdwEEGY, delta] = polyval(p, freqs, S);
        [freqsPerfEEG, logPowerPerfEEG] = getPerfEEGSingleCh_RegressionVals();
    
        nrSampsMA = ceil(length(dataSpctrmNormLog)/100);
        dataSpctrmNormLog = movmean(dataSpctrmNormLog, nrSampsMA);
        r2Num = max((logPowerPerfEEG-dataSpctrmNormLog).^2);
        r2Denom = max((logPowerPerfEEG-mean(dataSpctrmNormLog)).^2);
        %r2Num = max((logPowerPerfEEG-wdwEEGY).^2);
        %r2Denom = max((logPowerPerfEEG-mean(wdwEEGY)).^2);

        channSpecPerfEEG_R2 = r2Num/r2Denom;

        channSpecR2(mi) = channSpecPerfEEG_R2;
    
        %plot(freqsPerfEEG, spctrmLogPower); hold on;
        subplot(2,1,1)
        plot(freqsPerfEEG, dataSpctrmNormLog); hold on;
        plot(freqsPerfEEG, wdwEEGY); hold on;
        plot(freqsPerfEEG, logPowerPerfEEG); hold on;    
        ylabel('Power (uV^2)');
        xlabel('Freq (Hz)')
        legend('FFT', strcat('Current EEG (',num2str(channSpecPerfEEG_R2, '%.2f'),')'),  'Ideal EEG')
        subplot(2,1,2)
        plot(freqsPerfEEG, ((logPowerPerfEEG-wdwEEGY).^2));
        sgtitle(mtgLabels{mi})
        close()
    end
    dataSpctrmAllChanns(:,delSel) = [];
    dataSpctrmAllChannsAvg = mean(dataSpctrmAllChanns,1);
    spctrmLogPower = rescale(log10(dataSpctrmAllChannsAvg));

    [p, S] = polyfit(freqs, spctrmLogPower, 10);
    [wdwEEGY, delta] = polyval(p, freqs, S);
    [freqsPerfEEG, logPowerPerfEEG] = getPerfEEGChannAvg_RegressionVals();
    
    r2Num = sum((logPowerPerfEEG-wdwEEGY).^2);
    r2Denom = sum((logPowerPerfEEG-mean(wdwEEGY)).^2);
    r2PerfEEG = r2Num/r2Denom;

    plot(freqsPerfEEG, spctrmLogPower); hold on;
    plot(freqsPerfEEG, wdwEEGY); hold on;
    plot(freqsPerfEEG, logPowerPerfEEG); hold on;    
    ylabel('Power (uV^2)');
    xlabel('Freq (Hz)')
    legend('FFT', strcat('Current EEG (',num2str(channSpecPerfEEG_R2, '%.2f'),')'),  'Ideal EEG')
    close();
y
end

function r2PerfEEG = getNoiseIndexLevelA(fs, mtgLabels, dataWin)
    
    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);

    freqs = fs*(0:(nSamples/2))/nSamples;
    delSel = (freqs < 1) | (freqs > abs(fs/3));
    dataSpctrmAllChanns = zeros(nrMtgs, length(freqs));
    for mi = 1:nrMtgs
        freqs = fs*(0:(nSamples/2))/nSamples;
        signal = dataWin(mi,:);

        Y = fft(signal);
        P2 = abs(Y/nSamples);
        dataSpctrm = P2(1:nSamples/2+1);
        dataSpctrm(2:end-1) = 2*dataSpctrm(2:end-1);

        dataSpctrmAllChanns(mi,:) = dataSpctrm;
    end

    freqs(delSel) = [];
    dataSpctrmAllChanns(:,delSel) = [];
    spctrmLogPower = rescale(log10(mean(dataSpctrmAllChanns,1)));

    [p, S] = polyfit(freqs, spctrmLogPower, 10);
    [wdwEEGY, delta] = polyval(p, freqs, S);
    [freqsPerfEEG, logPowerPerfEEG] = getPerfEEG_RegressionVals();

    r2Num = sum((logPowerPerfEEG-spctrmLogPower).^2);
    r2Denom = sum((logPowerPerfEEG-mean(spctrmLogPower)).^2);
    r2PerfEEG = r2Num/r2Denom;

    %plot(freqs, spctrmLogPower); hold on;
    %plot(freqs, y1); hold on;
    % plot(freqsPerfEEG, logPowerPerfEEG); hold on;    
    % ylabel('Power (uV^2)');
    % xlabel('Freq (Hz)')
    % legend('Current EEG',  'Ideal EEG')
    % close();
end

